  NEW digital EP-releases available @ amazon.com // junodownload.com // djdownload.com // and many many more

  MUSIK NON STOP UNO - CD Compilation [SYNKCD000] Various Artists

  Dub / Techno / Minimal

  listen to the sampler:

  http://www.youtube.com/watch?v=X_lFWimqdMg

  Musik Non Stop Uno is the fruit of more than 8 months of hard work trying to select tracks and artists from around the globe to represent a semblance of the evolution of the techno music scene today.Uno, “One” in Spanish, is the first release from Syncopated Musik and features a mix of young, advanced and award winning talented artists such as the Swedish producer Hakan Lidbo, known for bringing an array of creatively diverse music styles and always keeping the groove as a watermark. Mexican producer Fax, known for his releases for Traum Records, and for being one of Mexico’s finest electronic music producers. Yapacc, member of Narcotic Syntax, is known for complex productions, and for acclaimed releases under the record label Perlon, defining the minimal techno music since 1997. Marcos Romero, the man behind the Syncopated Musik imprint, known for collaborations with Philip Glass and Luciano Supervielle of Bajofondo Tango Club among others, and also for shaping the electronic music scene in his native Uruguay. The locally known Djs and Producers James Patrick and Dave Wesley, both form crucial part of the Minneapolis techno music scene. Also part of the ensemble are Nicolas Ovalle, Daniela la Luz, Mateo Monestier, CHMA, Genna Greene and Sergio Soroa, talented musicians who are starting to release music in several record labels and getting great reviews for their performances and production skills.

  @ DISCOGS:

  http://www.discogs.com/Various-Musik-Non-Stop-Uno/release/1635498
